func GetSuffixStats(ID int32, ilvl int32, itemQuality proto.ItemQuality, itemType proto.ItemType, suffix proto.Suffix) Stats {
	var weighing = itemRandomSuffix[int32(suffix.Number())]
	var suffixPoints = getSuffixPoints(ID, ilvl, itemQuality, itemType)

	var stat []float64

	for _, weight := range weighing {
		stat = append(stat, math.Floor(weight*suffixPoints))
	}
	return FromFloatArray(stat)
}

func getSuffixPoints(ID int32, ilvl int32, itemQuality proto.ItemQuality, itemType proto.ItemType) float64 {
	var slotValue = getSlotValue(itemType)
	if slotValue == -1 {
		panic(fmt.Sprintf("Item %d with item type %s tried to use random suffix", ID, itemType.String()))
	}
	var suffixPoints = randPropPoints[ilvl][int32(itemQuality.Number())][slotValue]
	return suffixPoints
}

func getSlotValue(itemType proto.ItemType) int32 {
	switch itemType {
	case proto.ItemType_ItemTypeHead:
		return 1
	case proto.ItemType_ItemTypeNeck:
		return 3
	case proto.ItemType_ItemTypeShoulder:
		return 2
	case proto.ItemType_ItemTypeBack:
		return 3
	case proto.ItemType_ItemTypeChest:
		return 1
	case proto.ItemType_ItemTypeWrist:
		return 3
	case proto.ItemType_ItemTypeHands:
		return 2
	case proto.ItemType_ItemTypeWaist:
		return 2
	case proto.ItemType_ItemTypeLegs:
		return 1
	case proto.ItemType_ItemTypeFeet:
		return 2
	case proto.ItemType_ItemTypeFinger:
		return 3
	default:
		return -1
	}
}
